#Importamos libreras bsicas
import pandas as pd # manipulacion dataframes
import numpy as np  # matrices y vectores
import matplotlib.pyplot as plt #grfica

# Se cargan los datos
data= pd.read_csv("Calidad_del_Agua_para_Consumo_Humano_en_Colombia_20250210.csv")
data.head()

#Verificar informacion de los datos
data.info()

#Correccin del tipo de datos object a categoras
data['Departamento']=data['Departamento'].astype('category')
data['DepartamentoCodigo']=data['DepartamentoCodigo'].astype('category')
data['MunicipioCodigo']=data['MunicipioCodigo'].astype('category')
data['Municipio']=data['Municipio'].astype('category')
data['Ao']=data['Ao'].astype('category')
data['Nivel de riesgo']=data['Nivel de riesgo'].astype('category')
data['Nivel de riesgo urbano']=data['Nivel de riesgo urbano'].astype('category')
data['Nivel de riesgo rural']=data['Nivel de riesgo rural'].astype('category')

#Convertir valores categoricos a numericos
#No se pueden convertir estas variables a numerico debido a un valor atipico, por lo que, luego de eliminarse este valor se convertira a numerico
data['IRCAurbano']=data['IRCAurbano'].astype('category')
data['IRCArural']=data['IRCArural'].astype('category')

