"""# **Dimensiones de la Calidad de Datos**

**Completitud:** Est toda la informacin disponible? Hay datos faltantes o ausentes?

**Exactitud:**La informacin es correcta y libre de error?

**Conformidad:** Los valores de los datos estn conformes con los formatos esperados? Ejemplo: Una fecha en formato AAAA/MM/DD cuando debera ser DD/MM/AAAA.

**Oportunidad:** La informacin llega cuando se necesita?

**Duplicidad:** Existen mltiples instancias, innecesarias de los mismos objetos de datos en el conjunto de datos?

**Integridad:** Faltan datos relacionados importantes? Es clara la conectividad y las relaciones con otros datos?

# **Diagnstico de las dimensiones segn el perfilado:**
* Completitud: No existen valores nulos en ninguna variable
* Exactitud: Las variables "MunicipioCodigo", "Municipio", "IRCAurbano", "Nivel de riesgo urbano", "IRCArural", "Nivel de riesgo rural".
De estas variables "Nivel de riesgo rural", "IRCArural" tiene valores de atpicos superior a un 25% por lo que se eliminarn esta variable
debido a la gran cantidad de valores atpicos.
* Conformidad: Estn conformes a los esperados
* Oportunidad:
* Duplicidad: No se encuentran datos duplicados
* Integridad:

# **B. LIMPIEZA  DE LOS DATOS**
1. Deteccin de duplicados
2. Seleccin de datos
3. Limpieza de atpicos
4. Limpieza de nulos

**1. Deteccin de duplicados: No existen duplicados**

**2. Seleccin de datos**
"""

# Variables irrelevantes para el proceso de minera
data = data.drop('Nivel de riesgo rural',axis=1)
data = data.drop('IRCArural',axis=1)
data.head()

"""**3. Limpieza de datos atipicos: Se asigna a null**"""

#Se asigna valor nulo a los atpicos
data.MunicipioCodigo[data["MunicipioCodigo"] == "#TODOS"] = np.nan
data.Municipio[data["Municipio"] == "#TODOS"] = np.nan
data.IRCAurbano[data["IRCAurbano"] == "ND"] = np.nan
data["Nivel de riesgo urbano"][data["Nivel de riesgo urbano"] == "ND"] = np.nan
data.info()

"""**4. Limpieza de datos nulos: Imputacion**"""

#Se convierte el valor de IRCAurbano a numerico
data['IRCAurbano'] = pd.to_numeric(data['IRCAurbano'], errors='raise').astype('float64')
data.info()

#Limpieza de datos nulos: Imputacin por la media y moda
#Se valida que no se tenga mas del 15 - 20% de valores nulos
from sklearn.impute import SimpleImputer

#Imputacion de variables numricas: media
ImpNumeros = SimpleImputer(missing_values=np.nan, strategy='mean')
data[['IRCAurbano']] = ImpNumeros.fit_transform(data[['IRCAurbano']])
#Imputacion de variables categricas: moda
ImpCategorias = SimpleImputer(missing_values=np.nan, strategy='most_frequent')
data[['MunicipioCodigo', 'Municipio', 'Nivel de riesgo urbano']] = ImpCategorias.fit_transform(data[['MunicipioCodigo', 'Municipio', 'Nivel de riesgo urbano']])

data.info()

#Se tienen que volver a cambiar los valores a categoricos ya que se conviritieron en object al hacer la imputacion
data['MunicipioCodigo']=data['MunicipioCodigo'].astype('category')
data['Municipio']=data['Municipio'].astype('category')
data['Nivel de riesgo urbano']=data['Nivel de riesgo urbano'].astype('category')
data.info()

#Valores de la imputacin
print(ImpCategorias.statistics_)
print(ImpNumeros.statistics_)

