pd.value_counts(data["Nivel de riesgo"]).plot(kind="bar")

data.info()

from imblearn.over_sampling import SMOTE, SMOTENC
from collections import Counter

# Definir las caractersticas categricas por su ndice en X
categorical_features_indices = [0, 1, 2, 3, 6] # ndices de las columnas categricas en X

sm = SMOTENC(categorical_features=categorical_features_indices, k_neighbors=2, random_state=42) # Aad random_state para reproducibilidad
X = data.drop('Nivel de riesgo', axis=1)
Y = data['Nivel de riesgo']
X_bal, Y_bal = sm.fit_resample(X, Y)

print("Distribucin de la variable objetivo despus del balanceo:")
print(Counter(Y_bal))

# Verificar las dimensiones de los datos balanceados
print("Dimensiones de X balanceado:", X_bal.shape)
print("Dimensiones de Y balanceado:", Y_bal.shape)

# Creamos un dataframe con los resultados
data  = pd.DataFrame(columns=X.columns.values, data=X_bal)
data['Nivel de riesgo']=Y_bal
data['Nivel de riesgo'].value_counts().plot(kind='bar')

#Guardamos los datos preparados
data.to_csv('./datos_preparados_calidad_agua.csv')